  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0081046 includes chemical,
  meteorological, physical and underway - surface data collected from Ryofu Maru II
  in the Bismarck Sea, East China Sea (Tung Hai), North Pacific Ocean, Philippine
  Sea, Sea of Japan and South Pacific Ocean from 1989-11-17 to 2011-03-14 and retrieved
  during cruise 49RY19891117. These data include BAROMETRIC PRESSURE, CARBON DIOXIDE
  - AIR, Partial pressure (or fugacity) of carbon dioxide, SALINITY and SEA SURFACE
  TEMPERATURE. The instruments used to collect these data include Carbon dioxide (CO2)
  gas analyzer and Shower head chamber equilibrator for autonomous carbon dioxide
  (CO2) measurement. These data were collected by Akira Nakadate and Shu Saito of
  Japan Meteorological Agency; Pollutants Chemical Analysis Center; Marine Division;
  Global Environment and Marine Depertment as part of the VOS R/V Ryofu Maru Lines
  data set.nnThe Global Volunteer Observing Ship (VOS) Program is coordinated by the
  UNESCO International Ocean Carbon Coordination Project (IOCCP). International groups
  from 14 countries have been outfitting research ships and commercial vessels with
  automated CO2 sampling equipment to analyze the carbon exchange between the ocean
  and atmosphere.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
